import { div } from 'framer-motion/client';
import React from 'react';
import { useSpring, animated } from 'react-spring';


const Home = () => {
  const props = useSpring({ opacity: 1, from: { opacity: 0 } });

  return (
   <div>Hello world</div>
  );
};






export default Home;
